INSERT INTO `genere` VALUES (5,'ECCHI','Fra la vasta produzione dei fumetti giapponesi Ã¨ in costante crescita e diffusione quella relativa ai manga ecchi, una parola composta dell\'alfabeto del Paese del Sol Levante che, sostanzialmente, individua tutte quelle opere in cui sono rappresentati dei contenuti erotici o spinti ma che mai arrivano a toccare soglie di nuditÃ  o volgaritÃ  troppo spinte'),(6,'HORROR','Il genere horror giapponese Ã¨ molto famoso nella letteratura classica e nei film, dove ci ha regalato perle importanti per gli appassionati come la saga di The Ring, Uzumaki o Jijatsu Sakuru. A rendere particolarmente confacente la cultura giapponese con questo genere Ã¨ sicuramente la presenza, nella mitologia e nella cultura nipponica, di figure e di entitÃ  che si prestano bene ad essere interpretate come orrorifiche e spaventose, grazie ai racconti e alle leggende che aleggiano intorno alle stesse.'),(7,'ISEKAI','Sono ormai diffuse in tutto l\'Occidente le light novel, ovvero dei romanzi a cui vengono in seguito aggiunte delle illustrazioni per renderli dei veri e propri fumetti. Non tutti sanno, perÃ², che esiste un sottogenere di questa categoria che dÃ  vita ai cosiddetti manga isekai. Dalla traduzione letterale dell\'ideogramma giapponese - ovvero mondo differente - il genere isekai prevede che il protagonista dell\'opera si risvegli di punto in bianco, spesso dimenticandosi del suo passato o ricordandolo interamente o in parte, in un mondo nuovo, fantasy, distopico o reale, a seguito di un\'evocazione da parte di forze sovrannaturali o a seguito di una reincarnazione.'),(8,'SHOJO','Se stai pensando a romantiche e commoventi scene sotto una pioggia di petali di ciliegio, con molta probabilitÃ  potrai trovarle in un manga shojo. Il termine \"shojo\" significa \"ragazza\" e piÃ¹ che indicare un genere specifico si riferisce al destinatario piÃ¹ comune a cui sono indirizzati i contenuti. In questa tipologia di manga troviamo generalmente tematiche sentimentali, con protagonisti idealizzati e avvolti in un\'aria quasi magica. I personaggi principali sono perlopiÃ¹ ragazze o ragazzi dalla personalitÃ  e dai tratti idealizzati, quasi surreali.'),(9,'MECHA','Se siete fan di tutto ciÃ² che si trova al confine tra tecnologico e fantascientifico i manga mecha sono perfetti per voi. Amanti di universi tecnologicamente strabilianti unitevi! Tutto quello che state cercando Ã¨ proprio tra le pagine di questi manga.'),(10,'JOSEI ','hojo ma piÃ¹ âadultoâ'),(11,'ROMANTIC COMEDY','in parole povere le commedie romantiche si basano sullâelemento romantico e condiscono il tutto con triangoli amorosi, equivoci e molte gag comiche che hanno fatto la storia. Insomma, niente di particolarmente innovativo, se non il fatto che siano dannatamente coinvolgenti!'),(12,'DRAMMATICO ',NULL),(13,' PSICOLOGICO ',NULL),(14,'STORICO ',NULL),(15,'FANTASCIENZA ',NULL),(16,'SOPRANNATURALE ',NULL),(17,'FANTASY ',NULL),(18,'AZIONE ',NULL),(19,'MISTERO',NULL),(97,'COMMEDIA','');
